    <div className="contactDiv">
    <p className="pageTitleContact">Contact</p>
  <p className="contactText">
     <ul className="contactList">
       <li>Irene van Dijk</li>
       <li>Eerste Leeghwaterstraat 12</li>
       <li>1018RC Amsterdam</li>
       <li><FaPhone />  +31 6 48703611</li>
<li><HiOutlineMail /> <a href="mailto:irene.a.vandijk@gmail.com">irene.a.vandijk(at)gmail.com</a></li>
       <li><FaInstagram /> <a href="https://www.instagram.com/irene.arr/">irene.arr</a></li>
     </ul></p>
     </div>
     </div>
  </div>
);

